import React from 'react';
import {
	Grid,
	GridItem,
	Box,
} from '@chakra-ui/react';

const MainPage = () => {
	return (
			<Grid templateColumns='repeat(10, 1fr)' gap={3} h='200px' mt='20ox'>
				<GridItem colSpan={3} bg='tomato'></GridItem>
			</Grid>
	)
}

export default MainPage;
